import React, { useState, useRef, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();
  const userInfo = localStorage.getItem("userInfo") ? JSON.parse(localStorage.getItem("userInfo")) : null;
  const [open, setOpen] = useState(false);
  const menuRef = useRef(null);

  const logout = () => {
    localStorage.removeItem("userInfo");
    navigate("/login");
  };

  useEffect(() => {
    const onClick = (e) => {
      if (menuRef.current && !menuRef.current.contains(e.target)) setOpen(false);
    };
    document.addEventListener("click", onClick);
    return () => document.removeEventListener("click", onClick);
  }, []);

  return (
    <nav 
      className="navbar navbar-expand-lg shadow-sm sticky-top d-flex justify-content-between align-items-center px-4 py-3"
      style={{ 
        backgroundColor: '#e8f4fd', // Light blue-grey background
        minHeight: '70px'
      }}
    >
      {/* Brand */}
      <Link 
        className="navbar-brand fw-bold text-decoration-none" 
        to="/"
        style={{ 
          color: '#1a365d', // Dark blue
          fontSize: '1.5rem'
        }}
      >
        EventHub
      </Link>

      {/* Navigation Links - Only show when user is logged in */}
      {userInfo && (
        <div className="d-flex align-items-center gap-4">
          <Link 
            className="text-decoration-none" 
            to="/organizer/create"
            style={{ 
              color: '#2c5282', // Dark blue but lighter than brand
              fontSize: '1rem',
              fontWeight: '500'
            }}
          >
            Create an event
          </Link>
          <Link 
            className="text-decoration-none" 
            to="/?liked=1"
            style={{ 
              color: '#2c5282', // Dark blue but lighter than brand
              fontSize: '1rem',
              fontWeight: '500'
            }}
          >
            Likes
          </Link>
          <Link 
            className="text-decoration-none" 
            to="/bookings"
            style={{ 
              color: '#2c5282', // Dark blue but lighter than brand
              fontSize: '1rem',
              fontWeight: '500'
            }}
          >
            Tickets
          </Link>

          {/* User dropdown menu */}
          <div className="dropdown" ref={menuRef}>
            <button 
              className="btn btn-outline-secondary dropdown-toggle" 
              type="button" 
              onClick={() => setOpen(!open)}
              style={{ fontSize: '0.9rem' }}
            >
              {userInfo.username || userInfo.email || "Account"}
            </button>
            {open && (
              <div className="dropdown-menu dropdown-menu-end show mt-2 p-2" style={{ minWidth: 260 }}>
                <Link className="dropdown-item" to="/" onClick={() => setOpen(false)}>Browse events</Link>
                <Link className="dropdown-item" to="/bookings" onClick={() => setOpen(false)}>Tickets</Link>
                <Link className="dropdown-item" to="/?liked=1" onClick={() => setOpen(false)}>Liked</Link>
                <Link className="dropdown-item" to="/organizer/events" onClick={() => setOpen(false)}>Following</Link>
                <Link className="dropdown-item" to="/" onClick={() => setOpen(false)}>Interests</Link>
                {userInfo.role === "organizer" && (
                  <>
                    <div className="dropdown-divider" />
                    <Link className="dropdown-item" to="/organizer/events" onClick={() => setOpen(false)}>My events</Link>
                    <Link className="dropdown-item" to="/organizer/verify" onClick={() => setOpen(false)}>Verify tickets</Link>
                  </>
                )}
                <div className="dropdown-divider" />
                <Link className="dropdown-item" to="/profile" onClick={() => setOpen(false)}>Account settings</Link>
                <button className="dropdown-item text-danger" onClick={logout}>Log out</button>
              </div>
            )}
          </div>
        </div>
      )}

      {/* Show login/signup buttons when not logged in */}
      {!userInfo && (
        <div className="d-flex align-items-center gap-3">
          <Link className="btn btn-outline-primary" to="/login">Log In</Link>
          <Link className="btn btn-primary" to="/register">Sign Up</Link>
        </div>
      )}
    </nav>
  );
}
